import{_ as e,a as i}from"./chunks/Optical.BkFnt69g.js";import{_ as a,c as r,a2 as o,o as n}from"./chunks/framework.8rFHF1Cf.js";const s="/drone-in-a-box/assets/SwiftProMax/swiftProMaxProduct.jpg",l="/drone-in-a-box/assets/SwiftProMax/rpi4B.png",d="/drone-in-a-box/assets/SwiftProMax/Lidar.png",p="/drone-in-a-box/assets/SwiftProMax/GPS.png",c="/drone-in-a-box/assets/SwiftProMax/moters.png",g="/drone-in-a-box/assets/SwiftProMax/SwiftProMaxFrontSide.png",h="/drone-in-a-box/assets/SwiftProMax/SwiftProMaxBackSide.png",v=JSON.parse('{"title":"Swift Pro-Max Drone","description":"","frontmatter":{},"headers":[],"relativePath":"docs/swiftProMax/description.md","filePath":"docs/swiftProMax/description.md"}'),m={name:"docs/swiftProMax/description.md"};function f(u,t,b,x,y,w){return n(),r("div",null,t[0]||(t[0]=[o('<h1 id="swift-pro-max-drone" tabindex="-1">Swift Pro-Max Drone <a class="header-anchor" href="#swift-pro-max-drone" aria-label="Permalink to &quot;Swift Pro-Max Drone&quot;">​</a></h1><h2 id="description" tabindex="-1">Description <a class="header-anchor" href="#description" aria-label="Permalink to &quot;Description&quot;">​</a></h2><div class="margin"><p> The Swift Promax Drone is a versatile 500-gram drone designed for both indoor and outdoor navigation, making it an ideal platform for educational and research purposes. Equipped with an STM32F4 Arm Cortex M4 flight controller, it offers reliable flight stability and precision control. The onboard computer is a powerful Raspberry Pi 4 with a quad-core processor and 8GB of RAM, providing ample processing power for advanced tasks. It also supports integration with an NVIDIA Jetson for AI and deep learning applications (not included). </p><p> This drone is outfitted with sensors that enable high-accuracy flight, including an optical flow sensor, Lidar (range finder), GPS with compass for outdoor positioning, and the option to add an Intel RealSense depth camera for enhanced perception in complex environments. The combination of these sensors allows for smooth indoor and outdoor operation, making it capable of path planning, image processing, and mission planning. </p><p> Powered by brushless motors and offering a 10-minute flight time, the Swift Pro Drone supports popular firmware options like Ardupilot, Betaflight, and INAV, giving users flexibility in how they control and manage the drone. It can be flown using ExpressLRS, ROS1, or ROS2, further enhancing its adaptability to various autonomous flight tasks and research-driven missions. Whether used indoors for precise, obstacle-rich navigation or outdoors for GPS-based operations, it is a reliable tool for a wide range of applications. </p></div><h2 id="payload-capacity" tabindex="-1">Payload Capacity <a class="header-anchor" href="#payload-capacity" aria-label="Permalink to &quot;Payload Capacity&quot;">​</a></h2><ul><li><strong>Maximum Payload</strong>: 0Kgs</li></ul><h2 id="images" tabindex="-1">Images <a class="header-anchor" href="#images" aria-label="Permalink to &quot;Images&quot;">​</a></h2><p><img src="'+s+'" alt="Swift Pro Max"></p><h2 id="flight-time" tabindex="-1">Flight Time <a class="header-anchor" href="#flight-time" aria-label="Permalink to &quot;Flight Time&quot;">​</a></h2><ul><li><strong>Maximum Flight Time</strong>: 10 Minutes.</li></ul><h2 id="application" tabindex="-1">Application <a class="header-anchor" href="#application" aria-label="Permalink to &quot;Application&quot;">​</a></h2><p>Suitable for Indoor/Outdoor Flight, Path Planning, Image Processing, and Mission Planning</p><h2 id="components-used" tabindex="-1">Components Used <a class="header-anchor" href="#components-used" aria-label="Permalink to &quot;Components Used&quot;">​</a></h2><ul><li><p><strong>Flight Controller</strong>: <a href="https://flywoo.net/products/goku-gn745-45a-aio-bl_32-mpu6000-v3?srsltid=AfmBOorbbwncbJfNjdSvtDfeR1pO7N6U7WJpLcxdW_EToCIce4uHlw5y" target="_blank">FIYWOO GOKU GN7 45 AIO V3</a></p><div style="display:flex;align-items:center;"><div style="flex:1;"><p> The FIYWOO GOKU GN7 45 AIO V3 is a highly integrated flight controller designed for advanced drone applications. It features a 4-in-1 design, combining a flight controller, ESC (Electronic Speed Controller), and other essential components into a single compact unit. This integration simplifies the build process, reduces wiring complexity, and minimizes weight, making it ideal for high-performance and racing drones. </p></div><div style="flex:1;text-align:right;"><img src="'+e+'" alt="FIYWOO GOKU GN7 45 AIO V3" width="400" style="margin-left:20px;"></div></div><p><strong>Key Features:</strong></p><ul><li><strong>Processor:</strong> Equipped with a high-performance flight controller processor for smooth and reliable operation.</li><li><strong>ESC Integration:</strong> Includes a 45A ESC, providing efficient power management and support for high-current motors.</li><li><strong>Compatibility:</strong> Supports various flight stacks and is compatible with popular drone flight software like Betaflight, iNav, and others.</li><li><strong>Sensors:</strong> Integrates essential sensors for accurate flight control and stabilization.</li><li><strong>Build Quality:</strong> Designed with durability and reliability in mind, suitable for both professional and hobbyist applications.</li></ul></li></ul><br><ul><li><p><strong>Microprocessor</strong>: <a href="https://www.raspberrypi.com/products/raspberry-pi-4-model-b/" target="_blank">Raspberry Pi 4B</a></p><div style="display:flex;align-items:center;"><div style="flex:1;"><p> The Raspberry Pi 4 Model B is a versatile, credit card-sized computer that offers enhanced performance for a wide range of applications. Equipped with a quad-core Cortex-A72 CPU, it supports up to 8GB of RAM, making it suitable for everything from programming and media centers to DIY electronics projects. The board features dual HDMI outputs for 4K video, USB 3.0 ports for faster data transfer, and gigabit Ethernet for reliable network connectivity. With its extensive GPIO pins, the Raspberry Pi 4B allows for easy integration with various sensors and devices, making it a popular choice among hobbyists, educators, and developers. </p></div><div style="flex:1;text-align:right;"><img src="'+l+'" alt="Raspberry Pi Zero 2W" width="250" style="margin-left:20px;"></div></div></li></ul><br><ul><li><p><strong>Lidar</strong>: <a href="https://holybro.com/products/st-vl53l1x-lidar/" target="_blank">VL53L1X</a></p><p>The VL53L1X is a high-speed Time-of-Flight laser-ranging sensor from the ST FlightSense™ series.</p></li></ul><div style="display:flex;align-items:flex-start;"><div style="flex:1;margin-right:20px;"><table><thead><tr><th>Feature</th><th>Specification</th></tr></thead><tbody><tr><td><strong>Operating Voltage</strong></td><td>&gt;2.8 V</td></tr><tr><td><strong>Communication Type</strong></td><td>I²C</td></tr><tr><td><strong>Max Range</strong></td><td>120 CM</td></tr><tr><td><strong>Min Range</strong></td><td>5 CM</td></tr></tbody></table></div><div style="flex:1;text-align:right;"><img src="'+d+'" alt="Lidar Sensor" width="200"></div></div><br><ul><li><p><strong>Optical Flow Sensor</strong>: <a href="https://holybro.com/products/pmw3901-optical-flow-sensor" target="_blank">Holybro PMW3901 Optical Flow Sensor</a></p><div style="display:flex;align-items:center;"><div style="flex:1;"><p> The Holybro PMW3901 Optical Flow Sensor is a compact, UART-based sensor with a built-in BEC and pre-soldered 6-pin JST GH connector. It&#39;s compatible with PX4 and Ardupilot flight controllers and uses the same data format as the discontinued CX-OF model. Specs: 14 x 11 x 5 mm, 0.6 g, 19200 baud rate, 95 Hz frame rate, 2.0-3.6V power, 10 mA current. Data Format: Includes X/Y motion bytes, checksum, and surface quality. Package: Sensor, 170mm GH6P cable, TPU case. </p></div><div style="flex:1;text-align:right;"><img src="'+i+'" alt="Raspberry Pi Zero 2W" width="200" style="margin-left:20px;"></div></div></li></ul><br><ul><li><p><strong>GPS Sensor</strong>: <a href="https://holybro.com/products/micro-m10-m9n-gps" target="_blank">Micro M10</a></p><div style="display:flex;align-items:center;"><div style="flex:1;"><p> The Holybro Micro M10 GPS is a compact, high-accuracy GNSS module featuring the Ublox M10 receiver. It supports up to 4 GNSS constellations, offering 2.0m accuracy and up to 25 Hz update rate. With low power consumption (&lt;200mA) and a wide temperature range (-40~80°C), it&#39;s ideal for demanding applications. The module is lightweight (14g without case) and includes a ceramic patch antenna for reliable performance. </p></div><div style="flex:1;text-align:right;"><img src="'+p+'" alt="Raspberry Pi Zero 2W" width="200" style="margin-left:20px;"></div></div></li><li><p>Specifications</p><table tabindex="0"><thead><tr><th><strong>Feature</strong></th><th><strong>Holybro Micro M10 GPS</strong></th></tr></thead><tbody><tr><td><strong>GNSS Receiver</strong></td><td>Ublox M10</td></tr><tr><td><strong>Accuracy</strong></td><td>2.0m CEP</td></tr><tr><td><strong>Update Rate</strong></td><td>25 Hz (1 GNSS), 10 Hz (4 GNSS)</td></tr><tr><td><strong>Augmentation System</strong></td><td>EGNOS, GAGAN, MSAS, WAAS</td></tr><tr><td><strong>Input Voltage</strong></td><td>4.7-5.2V</td></tr><tr><td><strong>Power Consumption</strong></td><td>&lt; 200mA @ 5V</td></tr><tr><td><strong>Dimensions</strong></td><td>32 x 26 x 9mm (w/o Case)</td></tr><tr><td><strong>Weight</strong></td><td>14g (w/o Case)</td></tr></tbody></table></li></ul><br><ul><li><p><strong>Motors</strong>: <a href="https://geprc.com/product/geprc-speedx2-2105-5-2650kv-3450kv-motor/" target="_blank">GEPRC SPEEDX 2105.5 2650 KV</a></p><div style="display:flex;align-items:center;"><div style="flex:1;"><p> The GEPRC SPEEDX2 2105.5 2650KV brushless motor is designed for 3-4 inch FPV quads and 4-5 inch long-range drones. Weighing just 21.0g, its flat shape and “Hollow out” design improve heat dissipation for optimal performance. Equipped with a powerful N52H ARC magnet, this motor offers impressive torque, quick response, and smooth handling, making it suitable for both freestyle and racing. Its durable construction enhances crash resistance, and the 1.5mm shaft is compatible with most conventional propellers, making it an excellent choice for lightweight and efficient drone builds. </p></div><div style="flex:1;text-align:right;"><img src="'+c+'" alt="Moters" width="400" style="margin-left:20px;"></div></div></li></ul><br><ul><li><strong>Batteries: Bonka 11.1V 2200mAh 35C 3S Lithium Polymer Battery.</strong><div style="display:flex;align-items:center;" class="margin"><p> The Bonka 11.1V 2200mAh 35C 3S Lithium Polymer Battery Pack (SKU: 1597289) delivers reliable power for various applications. With a capacity of 2200mAh and a continuous discharge rate of 35C (77A), it supports 1-3C charging rates (5C max). The battery features a JST-XH balance plug and an XT60 discharge plug for easy connectivity. Measuring 106mm in length and 34mm in width, this battery is ideal for high-performance setups. </p></div></li></ul><h2 id="schematic" tabindex="-1">Schematic <a class="header-anchor" href="#schematic" aria-label="Permalink to &quot;Schematic&quot;">​</a></h2><br><p>Download the <a href="/drone-in-a-box/assets/files/SwiftProMaxFrontSide.png" download="SwiftProMaxFrontSide.png">Swift Pro Max Drone Schematic-Front Side</a> file.</p><br><p><img src="'+g+'" alt="Swift Pro Drone Schematic Front Side"></p><br><p>Download the <a href="/drone-in-a-box/assets/files/SwiftProMaxBackSide.png" download="SwiftProMaxBackSide.png">Swift Pro Max Drone Schematic-Back Side</a> file.</p><br><p><img src="'+h+'" alt="Swift Pro Drone Schematic Back Side"></p>',35)]))}const M=a(m,[["render",f]]);export{v as __pageData,M as default};
